def knight_min_health(dungeon):
    m, n = len(dungeon), len(dungeon[0])
    dp = [[0] * n for _ in range(m)]
    dp[0][0] = dungeon[0][0]
    for i in range(m):
        for j in range(n):
            if i > 0:
                dp[i][j] = max(dp[i][j], dp[i - 1][j] + dungeon[i][j])
            if j > 0:
                dp[i][j] = max(dp[i][j], dp[i][j - 1] + dungeon[i][j])
    return dp[m - 1][n - 1] + max(dungeon[m - 1][n - 1], 0)
