import math


def distance(x1, y1, x2, y2):
    return math.sqrt((x1 - x2) ** 2 + (y1 - y2) ** 2)


def check_collision(x1, y1, vx1, vy1, x2, y2, rx, ry):
    dx = x1 - x2
    dy = y1 - y2
    dist = distance(dx, dy, rx, ry)
    if dist < 0.001:
        return True
    else:
        return False


def check_agglomeration(x1, y1, vx1, vy1, x2, y2, rx, ry):
    dx = x1 - x2
    dy = y1 - y2
    dist = distance(dx, dy, rx, ry)
    if dist < 0.001:
        new_x = (vx1 * rx + vx2 * ry + vy1 * ry - ry * vx2) / (rx + ry)
        new_y = (vy1 * rx + vy2 * ry + vx1 * ry - rx * vy2) / (rx + ry)
        return new_x, new_y
    else:
        return None


def simulate(x1, y1, vx1, vy1, x2, y2, rx, ry):
    if check_collision(x1, y1, vx1, vy1, x2, y2, rx, ry):
        new_x, new_y = check_agglomeration(x1, y1, vx1, vy1, x2, y2, rx, ry)
        if new_x is not None:
            x1 = new_x
            y1 = new_y
            vx1 = new_x * rx + new_y * ry - ry * vx2
            vy1 = new_y * rx + new_x * ry - rx * vy2
            rx = ry
            ry = vx2
            vy2 = vy2
            return x1, y1, vx1, vy1, rx, ry
        else:
            return x1, y1, vx1, vy1, rx, ry
    else:
        return x1, y1, vx1, vy1, rx, ry


def main():
    n = int(input())
    x1, y1, vx1, vy1, r1 = map(int, input().split())
    x2, y2, vx2, vy2, r2 = map(int, input().split())
    x, y, vx, vy, r = simulate(x1, y1, vx1, vy1, x2, y2, r1, r2)
    if x == x2 and y == y2 and vx == vx2 and vy == vy2 and r == r2:
        print(n, round(time, 3))
