def is_prime(n):
    if n <= 1:
        return False
    for i in range(2, int(n ** 0.5) + 1):
        if n % i == 0:
            return False
    return True


def solve():
    n, m = map(int, input().split())
    matrix = []
    for _ in range(n):
        matrix.append(list(map(int, input().split())))
    min_moves = float('inf')
    for i in range(1 << n * m):
        moves = 0
        matrix_copy = [row[:] for row in matrix]
        for j in range(n * m):
            if i >> j & 1:
                moves += 1
                for k in range(n):
                    for col in range(m):
                        matrix_copy[k][col] += matrix[k][col]
        if is_prime(sum(matrix_copy[i - 1] for i in range(1 << n * m))):
            min_moves = min(min_moves, moves)
    print(min_moves)


