    cuts = []
    for i in range(m):
        l, r = map(int, input().split())
        for j in range(n):
            if bombs[j][0] == 1 and bombs[j][1] == l:
                cuts.append(j + 1)
            elif bombs[j][0] == 0 and bombs[j][1] == r:
                cuts.append(j + 1)
    possible = True
    for cut in cuts:
        all_deactivated = True
        for bomb_id in range(1, n + 1):
            if bomb_id in cuts:
                continue
            if bombs[bomb_id - 1][1] <= cut <= bombs[bomb_id - 1][0]:
                all_deactivated = False
                break
        if not all_deactivated:
            possible = False
            break
    if not possible:
        print('-1')
    else:
        print(*cuts)


