    n = len(a)
    i = n - 2
    while i >= 0 and a[i] >= a[i + 1]:
        i -= 1
    if i == -1:
        return
    j = n - 1
    while a[j] <= a[i]:
        j -= 1
    a[i], a[j] = a[j], a[i]
    l = i + 1
    r = n - 1
    while l < r:
        total_sum = 0
        for k in range(l, r + 1):
            total_sum += a[k]
        if total_sum < a[l]:
            l += 1
        elif total_sum > a[r]:
            r -= 1
        else:
            break
    a[l], a[r] = a[r], a[l]


