def solve():
    n, k, t = map(int, input().split())
    mod = 1000000009
    dp = {}

    def count_ways(index, current_sum, cards_picked):
        if (index, current_sum, tuple(cards_picked)) in dp:
            return dp[index, current_sum, tuple(cards_picked)]
        if index == n * k:
            return 1 if current_sum == t else 0
        ways = 0
        for i in range(1, k + 1):
            ways = (ways + count_ways(index + 1, current_sum + i * i,
                cards_picked + [i])) % mod
        dp[index, current_sum, tuple(cards_picked)] = ways
        return ways
    print(count_ways(0, 0, []))


