    mod = 10 ** 9 + 7
    dp = {}

    def count_paths(x, y, n, current_x, current_y):
        if (x, y) in dp:
            return dp[x, y]
        if x == n and y == n:
            return 1
        if x > n or y > n:
            return 0
        if x < 0 or y < 0:
